(1, 'About Us', 'about', '<p>About</p>\r\n', '<div class=\"vision\">\r\n<div class=\"vision_left\">\r\n<div class=\"vission_inner\">\r\n<div class=\"icon\"><img src=\"https://www.thedubaivisa.com/public/front/includes/images/vission.png\" /></div>\r\n\r\n<h1>Vision</h1>\r\n\r\n<p>To deliver a result driven and customer-centric visa service by setting a new benchmark in the field of UAE Visa processing.</p>\r\n</div>\r\n<!--end vission_inner--></div>\r\n\r\n<div class=\"vision_left\">\r\n<div class=\"vission_inner\">\r\n<div class=\"icon\"><img src=\"https://www.thedubaivisa.com/public/front/includes/images/mission.png\" /></div>\r\n\r\n<h1>Mission</h1>\r\n\r\n<p>We aim to cater the finest and process-efficient services to our esteemed customers on the first go.Excellent services always satisfy a customer, but sustaining that happiness for long is something that goes beyond just fulfilling. Hence, we endeavour to provide a cutting edge service, which not only please a customer, but also offers value for money in all sphere of business.</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"clr\">&nbsp;</div>\r\n</div>\r\n<!--end vision-->\r\n\r\n<div class=\"left_right_cover\">\r\n<div class=\"about_left\"><img src=\"https://www.thedubaivisa.com/public/front/includes/images/about1.jpg\" /></div>\r\n\r\n<div class=\"about_right\">\r\n<p>It&rsquo;s been more than a decade that Dubai VISA has catered some differentiated services and solutions to its customers across the globe. During this successful journey of visa services, we have attained an unparalleled expertise in the UAE Visa application processing. Currently, we are globally operational for the processing of UAE Visas, which drives us to a new feat in the domain of Visa Services.</p>\r\n\r\n<p>With accelerating numbers and successful issuance of more than 20,000 UAE visas, at Dubai VISA.com we ensure your visa gets accurately processed and timely delivered. We comprehend the requirements of our customers; and based upon their requirements, we aspire to render them a hassle-free service pertaining to the submission of their visa applications and timely delivery.</p>\r\n</div>\r\n\r\n<div class=\"clr\">&nbsp;</div>\r\n</div>\r\n<!--end left_right_cover-->\r\n\r\n<div class=\"left_right_cover\">\r\n<div class=\"about_left flr\"><img src=\"https://www.thedubaivisa.com/public/front/includes/images/about2.jpg\" /></div>\r\n\r\n<div class=\"about_right flt\">\r\n<p>At Dubai VISA, our services are backed by dedicated team and nimble in-house support. With certified Quality Management System, we assure to provide you an effective and secured Visa processing through our advanced and seamless process. This helps our professionals in delivering an excellent service with enhanced customer satisfaction in the visa services domain. Based upon the specific Visa service requirements and their application areas, our integrated services cater you a blend of operational, informative and financial solutions for an end-to-end visa processing with maximum approval ratios. Besides, our professionals are well-versed with the entire lifecycle of visa processing that mitigates the propensity of getting your application rejected or delayed.</p>\r\n</div>\r\n\r\n<div class=\"clr\">&nbsp;</div>\r\n</div>\r\n<!--end left_right_cover-->\r\n\r\n<div class=\"left_right_cover\">\r\n<div class=\"about_left\"><img src=\"https://www.thedubaivisa.com/public/front/includes/images/about3.jpg\" /></div>\r\n\r\n<div class=\"about_right\">\r\n<p>The mounting numbers of visa applications and our continual operational enhancement take us to the leading edge of today&rsquo;s visa services. Not only is this, processing those applications with optimum success rates clearly signifies the extent to which we have successfully accomplished our vision of becoming a global leader in the same industry.</p>\r\n\r\n<p>Today, it s a proud moment for us indeed. Our continual endeavour of rendering the finest and zero error services to our esteemed customers has set a new benchmark in UAE Visa processing services. In future course of operation, Dubai VISA also aims to sustain this pace of success and reach beyond customer s expectation by fulfilling their requirements in all aspect of business spheres, which include unmatched solutions, faster Visa processing, quick application tracking and much more. Hence, the prospective applicants willing to make a trip to UAE/Dubai can apply here at Dubai VISA and experience our distinguished services. We make it simple, faster and successful. With us, you are just one step away to make it to UAE.</p>\r\n</div>\r\n\r\n<div class=\"clr\">&nbsp;</div>\r\n</div>\r\n<!--end left_right_cover-->', '149631835320170601.jpg', '1', 'test', 'tset', 'teste', '2017-07-13 05:46:59', NULL),
(3, 'COMPLAINTS ', 'complaints', '<p>Complaints</p>\r\n', '<div class=\"privacy\">\r\n<div class=\"bottom_privacy\">\r\n<p class=\"top_content_privacy\">If you are not satisfied with our services or you have any queries regarding UAE Visa services, feel free to put across your words to us and our associates will response you at the earliest.</p>\r\n</div>\r\n<!--end bottom_privacy--></div>\r\n', '149631961120170601.jpg', '1', 'complaints', 'complaints', 'complaints', '2017-07-13 05:47:17', NULL),
(4, 'REMARKS  ', 'remark', '<p>REMARKS</p>\r\n', '<div class=\"privacy\">\r\n<div class=\"bottom_privacy\">\r\n<p class=\"top_content_privacy\">If you have any remarks to share about Get Dubai Visa.com and want to rate our services, feel free to share it here. We are open to hear from you, which may help us in getting our services better than the best.</p>\r\n</div>\r\n<!--end bottom_privacy--></div>\r\n<!--end privacy-->', '149631985820170601.jpg', '1', 'remark', 'remark', 'remark', '2017-06-01 12:24:18', NULL),
(5, 'TERMS CONDITIONS', 'terms', '<p>terms</p>\r\n', '<div class=\"privacy\">\r\n<div class=\"bottom_privacy\">\r\n<h2>We aim to cater the finest and process-efficient UAE Visa services to our esteemed customers on the first go.</h2>\r\n\r\n<p>The Terms and Conditions of Dubai Visa.com are outlined here, which are administered by UAE laws. No changes or alteration to these Terms and Conditions will be considered valid unless and otherwise the same is brought into practice by any of our travel consultants in writing on Company letterhead with official signature and stamp. Accordingly, based upon the requirements and requests of our client, we will process an application for the same. However, for rendering any erroneous information by any unauthorised consultants, Dubai Visa.com shall not be held liable. The company will make all attempts so that the required Visa gets processed within the stipulated time. Nevertheless, by no means the company will be legally liable for any of the events such as; rejection of visa application, issuance of erroneous Visa, unwanted delay in visa processing occurring with the UAE Visa Issuing Authority. If in case, any of the cited instances occurred on account of company&rsquo;s error or omission, then the company is merely liable to refund all fees paid or just the cost of a replacement Visa. However, in no case the Company shall be liable for any substantial losses, but not limited to: lost airfares, profits/income.</p>\r\n\r\n<h2>Termination and Cancellation of Account</h2>\r\n\r\n<ul class=\"listing\">\r\n	<li>Dubai Visa.com reserves the right to cancel orders or payments just before the origination of the delivery without stating any reasons for executing the same.</li>\r\n	<li>You are allowed to cancel an order within a constitutional period of 7 working days from the date of receiving an email confirmation against your order from the Company website. However, the Company will initiate the delivery of your order immediately after obtaining your permission so that the same gets delivered before the expiry of its statutory period and the services will be deemed to have been provided giving you no further claim or right to cancel your order. The moment you submit your order, Dubai Visa.com will specifically request your permission to do so.</li>\r\n	<li>Cancelling an order will levy a charge of USD 40 per application. This amount is incurred as the payment gateway transfer charge.</li>\r\n	<li>In case of any rejection of your UAE Visa Application by the UAE Visa Issuing Authority, Dubai Visa.com shall not provide you the refund. Under such scenarios, applicants will be required to re-apply for the same adhering to the UAE visa laws.</li>\r\n	<li>If under any situation, the Company falls short of catering you the services as mentioned in the contract, then you may receive refunds.</li>\r\n	<li>The refund is released in the same mode of payment immediately after the order gets cancelled and it further takes 2 weeks time for customers to get the refund into their accounts.</li>\r\n</ul>\r\n\r\n<h2>Pricing &amp; Availability</h2>\r\n\r\n<ul class=\"listing\">\r\n	<li>DubaiVisa.com doesn&rsquo;t promise that your UAE Visa Application will be accepted and approved by the UAE Visa Issuing Authority. Therefore, in any which case, DubaiVisa.com shall not be held responsible if your UAE Visa Application gets failed or you fail to receive any other requested services from DubaiVisa.com. Our endeavour is to put all efforts in checking the online submission of your Visa Application and forward it for further processing to the UAE Visa Issuing Authority. Hence, our services get fulfilled the moment we check your the online submission of your Visa and pass it to the competent authority for approval.</li>\r\n	<li>It is the responsibility of every prospective applicant to abide by the required guidelines stated by the UAE Government.</li>\r\n	<li>In case of any incompetent or fraudulent information/documents provided by an applicant or he/she is not entitled to avail the requested services, DubaiVisa.com shall not be responsible for the same. Also, for providing any erroneous supporting documents that fail to comply with the regulations of UAE Visa Issuing Authority, DubaiVisa.com shall not accept any responsibility.</li>\r\n	<li>Dubai VISA.com neither represents any Government Department of UAE, nor does it issue any UAE Visas nor affiliated to any UAE Embassy abroad.</li>\r\n	<li>The required UAE Visa Application and associated services are provided on the official webpage of UAE government&#39;s Tourist Visa.</li>\r\n	<li>All charges/fees mentioned on this website are incurred for a given service, and no applicant will be entertained for requesting a change in the given prices/information.</li>\r\n	<li>In case of any changes in the price for a given services as requested by an applicant, and the same has already been dispatched by Dubai VISA.com, the actual price will be levied which was mentioned at the time of placing the order.</li>\r\n	<li>All prices/fees are listed on the website for a given service that includes VAT at applicable rate.</li>\r\n	<li>Sometimes, Visa fee also includes some third party charges (e.g. bank transaction charges), which are levied by the Government of UAE.</li>\r\n</ul>\r\n\r\n<p>If in any case, you are not agree with these Terms of use, or you are being compelled to meet the cited terms, please do not use or apply UAE Visa from <a href=\"javascript:;\">Dubai VISA.com</a>.</p>\r\n\r\n<h2>Limits on Use</h2>\r\n\r\n<p>You are strictly prohibited to use www.DubaiVisa.com and its services for your personal benefit and interest. Furthermore, selling or catering any services through our website to any third party is also not permissible to you.</p>\r\n\r\n<h2>Security</h2>\r\n\r\n<ul class=\"listing\">\r\n	<li>Our website reserves the rights of users from time-to-time;</li>\r\n	<li>In order to restrict the access of any individual(s) to DubaiVisa.com and/or withdrawal of any content from the webpage for the time being;</li>\r\n	<li>To practice anything else that DubaiVisa.com truly believes to protect the security and integrity of DubaiVisa.com and its database&rsquo;s information;</li>\r\n	<li>To bring in anything new or to alter anything and/or additional security measure, which is not accompanied by notice.</li>\r\n</ul>\r\n\r\n<h2>Web Content &amp; Precision</h2>\r\n\r\n<p>All accessible contents or information provided on Dubai VISA.com comply with the legal terms, and are accumulated with legitimate skill and care. However, some information and contents might be there on our website, which are provided by any third party. In case of any inaccuracy or errors on that information, Dubai VISA.com shall not be held responsible. Also, in certain cases some omissions or accessible issue may occur, which are quite instinctive in any internet-related system, and Dubai VISA.com has no reasonable control over it. Such errors or omissions may occur on account of operator/user&rsquo;s error or it may be influenced by a software/system or malfunctions. Therefore, user/applicant may verify the accuracy of the provided information before relying on it completely. The website is dynamic in nature and it reserve rights to make any changes in the content at any point of time without any prior notice.</p>\r\n\r\n<h2>Ownership &amp; Limited Licence</h2>\r\n\r\n<p>The user/applicants are entitled to a limited licence to download the required content/information from the website of Dubai VISA.com. They are further permitted to use the same and take a print of the information for personal or non-commercial purposes, provided that all proprietary notices, trademarks and copyright are kept intact. Unless mentioned unambiguously, using, copying, retransmission and redeployment of any content of Dubai VISA.com are rigidly proscribed. Thus, owner/user of this limited licence is subject to an agreement that he/she will comply with these terms and conditions before accessing, using and downloading the same, which are legally owned by Dubai VISA.com or licensed to <a href=\"javascript:;\">Dubai VISA.com</a>.</p>\r\n\r\n<p>The information/document downloaded or used from Dubai VISA.com are only accessible in accordance with the licence of end user adhering to the terms of that software, or when there is no such licence, and the user is allowed by a non-transferable or non-exclusive license to use that software for using Dubai VISA.com. It clearly denotes that Dubai VISA.com is prohibited in accordance with the cited terms and conditions of use.</p>\r\n\r\n<p>All Intellectual Proprietary rights and copyright that are not granted to a user as per these Terms of use are hereby exclusively reserved to Dubai VISA.com or, in case of any other logos, brands and Company names that are featured on the website of Dubai VISA.com, their respective owners.</p>\r\n\r\n<h2>Privacy Policy</h2>\r\n\r\n<p>The moment a user/applicant access our website, all the required information are stored in the database of Dubai VISA.com. Whatever information fetched through our &quot;contact us&quot; option, will only be restricted to Dubai VISA.com, and the same will be used to contact the user while addressing his/her queries. As per the provision of applicable law, user may request us for obtaining a copy of User Data (if any) by paying a small fee. Besides, user may also contact us if he/she wishes to deactivate/remove/alter the User Data. All the user details that get stored in our database will never be sold or revealed to any third party unless/otherwise any requirement arises to share the same for service related matters. Thus the information is absolutely safe and secured with us.</p>\r\n\r\n<p>Considering a hassle-free navigation and effortless functioning, Dubai VISA.com uses cookies; this further helps us in catering a better experience to the user.</p>\r\n\r\n<p><strong>User Consent:</strong> Upon accessing the website of Dubai VISA.com and using its information, you permit Dubai VISA.com to process/transfer the User Data, which is required for providing you the relevant services, and allow you to use the site for the said purpose.</p>\r\n\r\n<h2>Links</h2>\r\n\r\n<p>Visitors/Users should be watchful while accessing to any third party sites through Dubai Visa.com. Any such links provided on the website of Dubai Visa.com are only for service purposes. Dubai Visa.com holds no right/control over the privacy practices of those links/sites and hence, shall not be held responsible for any changes/information provided on those links/sites. Furthermore, Dubai Visa.com is not liable for any third party information or opinions that are being catered (if any) on/through <a href=\"javascript:;\">Dubai Visa.com</a>.</p>\r\n\r\n<h2>Disclaimer and Limitation of Legal Responsibility</h2>\r\n\r\n<p><strong>a)</strong> Dubai VISA.com hereby disclaims about the completeness, accuracy and adequacy of its content and do not warrant you that the information provided here are always up-to-date. Any information that you access through our webpage give you no warrantee that the same will always be available, operational, accessible, virus-free and error-free. Hence, according to the Terms of use of these provisions, you agree that the only antidote left to you for breaching any of the cited Terms of use shall be for our breach of contract as per these Terms.</p>\r\n\r\n<p><strong>b)</strong> Subject to point number (d), Dubai VISA.com disclaims any loss/damages, liability, data corruption, punitive loss, wasted time, loss of goodwill, opportunity and profits caused in relation to use of any information/services provided through it, howsoever arising, as per agreement, trot or otherwise, even if the same was projected or Dubai VISA.com was aware of the propensity of such liability/damage/loss.</p>\r\n\r\n<p><strong>c)</strong> Subject to point number (d) below, or else so far as legitimated, total legal responsibility of Dubai VISA.com as per the Terms of use in respect of direct liability, loss or damage, howsoever arising, as per agreement, trot or otherwise, shall be limited as per claim or a series of claims to USD 50.</p>\r\n\r\n<p><strong>d)</strong> None of these cited Terms of use shall limit our legal responsibility for (i) damage/loss for death; (ii) individual injury caused on account of our inattention; or (iii) for any deceitful or false misrepresentation made by us or those under our control.</p>\r\n\r\n<p><strong>e)</strong> Any consumer who is using Dubai VISA.com shall be refrained from all of these cited Terms of use and no legitimate provisions will further limit his/her statutory rights.</p>\r\n\r\n<h2>Severability</h2>\r\n\r\n<p>In accordance with the legitimate provision, if any of these Terms of use are found unacceptable or unenforceable at any point of time by the forum of a competent jurisdiction, court or tribunal, that will not result into nullify the remainder of these Terms of use. The cited Terms of use shall be altered or amended only by disuniting or modifying the provisions that are essential to make them valid and legitimate. If in case the same is not applicable, then substitute provisions can be applied to make these Terms of use valid and enforceable. Any unacceptable or unlawful provisions shall be severable from these Terms of use so that their authenticity and enforceability shall not get impacted again by any forum of a competent jurisdiction, court or tribunal.</p>\r\n\r\n<h2>Terms of Use &amp; Alterations</h2>\r\n\r\n<p><a href=\"javascript:;\">DubaiVisa.com</a> reserves the right to alter or change its Terms of use without any prior intimation. Continuation of your access to Dubai Visa.com website or availing any services post alteration will constitute your acceptance of those new/amended Terms of use. Hence, before making any further use of Dubai Visa.com, you should go through the same cautiously.</p>\r\n\r\n<h2>Termination</h2>\r\n\r\n<p>If in case Dubai Visa.com believes that you are using the website/services breaching any of the stated Terms &amp; Conditions, Dubai Visa.com reserve the right to limit your access to the website at any point of time without any intimation.</p>\r\n\r\n<h2>Governing Law</h2>\r\n\r\n<p>Use of Dubai Visa.com and its relevant services are governed by UAE law. Hence, you are deemed to abide by any disputes or claims associated with Dubai Visa.com to the authority of the UAE courts.</p>\r\n\r\n<h2>Visa and Passport</h2>\r\n\r\n<p>For any information related to Visa and Passport, user should consult with the relevant Consulate /Embassy. Dubai VISA.com will review the documents and other information before the departure. The reason being, sometimes the prerequisite may differ. However, at any point of time, Dubai VISA.com shall not be held responsible if an applicant/user is detained at airport or refused to board the flight or gets no access to the territory of visiting country on account of any of the following reasons that are occurred from use&rsquo;s end:</p>\r\n\r\n<ul class=\"listing\">\r\n	<li>Not accompanied by the correct/valid Passport</li>\r\n	<li>Not carrying the essential documents and Visa, which are required before accessing to the territory of a foreign country or required at the visiting airport.</li>\r\n</ul>\r\n\r\n<p><strong>Health:</strong> Prior flying to the visiting country, user should consult with the doctor about his/her health condition and recommended inoculations, as the same may change at any point of time. Furthermore, a user is solely responsible if he/she is undergoing the prescribed medicines and following the medical counsel as instructed.</p>\r\n\r\n<p>All services rendered through Dubai VISA.com are in clear understanding that Dubai VISA.com shall not be relied or liable for making any suggestions or decisions related to user&rsquo;s voyage. Dubai VISA.com doesn&rsquo;t warranty you for the disseminated information on the website and its uninterrupted availability, precision, security, compatibility or any services offered.</p>\r\n</div>\r\n<!--end bottom_privacy--></div>\r\n<!--end privacy-->', '149631918320170601.jpg', '1', 'terms', 'terms', 'terms', '2017-07-06 10:05:12', NULL),
(6, 'PROCLAMATION OF PRIVACY', 'privacy', '<p>privacy</p>\r\n', '<div class=\"privacy\">\r\n<div class=\"top_privacy\">\r\n<p>&quot;We aim to cater the finest and process-efficient services to our esteemed customers on the first go, where anyone can apply for UAE Visa and get it done with ease.&quot;</p>\r\n</div>\r\n<!--END top_privacy-->\r\n\r\n<div class=\"bottom_privacy\">\r\n<p class=\"top_content_privacy\">At Dubai VISA.com, we adhere to a rigid privacy policy to keep all the information safe and protected. We keep a regular tab on how the shared information is used and processed and in what context. In case we bring any changes to our privacy policies, we keep our visitors updated about the same through this section. By accessing the pages of Dubai VISA.com, you agree to all our Privacy Proclamations and relevant Terms and Conditions. Dubai Visa.com reserves all right to modify the same at any point of time.</p>\r\n\r\n<h2>Collected Information</h2>\r\n\r\n<p>We keep our customers always transparent about our work procedures. All the information collected from our esteemed customers is merely used for rendering them the finest service in UAE Visa processing. No information is revealed or shared with any of the third parties unless it is permitted by the applicant or customer. Hence, all information catered to us is always confidential and protected from any unauthorized access.</p>\r\n\r\n<h2>Cookies</h2>\r\n\r\n<p>Cookie is basically a technical terminology, which works as a communication bridge between web server and a web browser. A cookie resides in your computer in the form of a small file for better comprehension of your web access. There is a traffic log cookie that keeps us updating on your every move on our webpage, which further helps us in analysing your quest; and the extent to which we need to evolve our performances for better customer experience. A user is always free to accept or reject any cookies while browsing. In case there is a default setting in your browser, you may further allow or reject the cookies.</p>\r\n\r\n<h2>Disclaimer</h2>\r\n\r\n<p>Information shared and communicated over Internet are subject to several security perils. Hence, in case of any damages or losses whatsoever, special or castigatory, direct or indirect, incidental or consequential, alteration or deletion, confidential or exposure, security violation, system failure due to unauthorized use or access, Dubaivisa.com shall not be held responsible for any consequences. Dubaivisa.com hereby completely disclaims all assurances with regard to the use of software and hardware to protect this website from any special, consequential or direct damages and support the website with all implicit warranties. Hence, Dubaivisa.com or its employees, officers, subsidiaries, affiliates, partners, third-party agents and heir shall not be directly/indirectly liable to you in any which scenario for any errors, misuse, viruses, third party interceptions, inaccuracies, loss of data due to hacker attacks, disruptions in the communication or delivery of services. Furthermore, it is to be informed that for the sake of information, Dubaivisa.com is linked to other websites as well. Thus, in any way Dubaivisa.com is not liable for the breach of any privacy or use of the content of those websites.</p>\r\n\r\n<p>Also, Dubai VISA.com neither represents any Government Department of UAE, nor does it linked with any UAE Embassy abroad.</p>\r\n\r\n<h2>Summary</h2>\r\n\r\n<p>Upon accessing the website of Get Dubai Visa and using its services, you unreservedly agree and comply with all the privacy policies and relevant terms and conditions. If you resist complying with any of our privacy policies or privacy statement, please do not use this site.</p>\r\n</div>\r\n<!--end bottom_privacy--></div>\r\n<!--end privacy-->', '149631925620170601.jpg', '1', 'privacy', 'privacy', 'privacy', '2017-07-13 05:47:41', NULL),
