(10, 'HOW TO APPLY', 'howto', '<p>how to</p>\r\n', '<div class=\"how_apply\">\r\n<h1>APPLICATION PROCEDURE FOR UAE VISA</h1>\r\n\r\n<p>At Dubai VISA.com, applying for UAE Visa includes the following FOUR steps:</p>\r\n\r\n<div class=\"how_apply_inner1\">\r\n<div class=\"how_apply_inner_left\">\r\n<h1>Step 1</h1>\r\n\r\n<h4>SELECT YOUR<br />\r\nCOUNTRY OF<br />\r\nRESIDENCE</h4>\r\n\r\n<div class=\"l_arrow\"><img src=\"https://www.thedubaivisa.com/public/front/includes/images/arrow1.png\" /></div>\r\n</div>\r\n\r\n<div class=\"how_apply_inner_right\">\r\n<div class=\"how_apply_inner_content\">\r\n<p>Considering our incessant operational enhancement and accelerating numbers of visa issuance, we enlist an extensive numbers of countries ensuring your country of residence gets covered under that list, and your application for UAE Visa also gets processed from that country without a fuss</p>\r\n</div>\r\n\r\n<div class=\"how_apply_inner_images\"><img src=\"https://www.thedubaivisa.com/public/front/includes/images/apply_map.jpg	\" /></div>\r\n\r\n<div class=\"clr\">&nbsp;</div>\r\n</div>\r\n\r\n<div class=\"clr\">&nbsp;</div>\r\n</div>\r\n\r\n<div class=\"how_apply_inner2\">\r\n<div class=\"how_apply_inner_left\">\r\n<h1>Step 2</h1>\r\n\r\n<h4>SELECT THE<br />\r\nRELEVANT VISA<br />\r\nCATEGORY</h4>\r\n\r\n<div class=\"l_arrow\"><img src=\"https://www.thedubaivisa.com/public/front/includes/images/arrow2.png\" /></div>\r\n</div>\r\n\r\n<div class=\"how_apply_inner_right\">\r\n<div class=\"how_apply_inner_content\">\r\n<p>We offer five various categories of UAE Visas and we suggest our prospective applicants to select the relevant visa category before flying to UAE. In our visa category, we cater you translucent information about the entire prerequisite of UAE Visa, so that you get it clear right from the beginning while applying for UAE Visa.</p>\r\n</div>\r\n\r\n<div class=\"how_apply_inner_images\"><img src=\"https://www.thedubaivisa.com/public/front/includes/images/book.jpg\" /></div>\r\n\r\n<div class=\"clr\">&nbsp;</div>\r\n</div>\r\n\r\n<div class=\"clr\">&nbsp;</div>\r\n</div>\r\n\r\n<div class=\"clr\">&nbsp;</div>\r\n\r\n<div class=\"how_apply_inner3\">\r\n<div class=\"how_apply_inner_left\">\r\n<h1>Step 3</h1>\r\n\r\n<h4>FILL UP YOUR<br />\r\nAPPLICATION<br />\r\nFORM</h4>\r\n\r\n<div class=\"l_arrow\"><img src=\"https://www.thedubaivisa.com/public/front/includes/images/arrow3.png\" /></div>\r\n</div>\r\n\r\n<div class=\"how_apply_inner_right\">\r\n<div class=\"how_apply_inner_content\">\r\n<p>Be it a first timer or a frequent flyer, our simplified application form will hardly consume two minutes of yours. Keeping in mind the numbers of applicants in one single group, we have designed our application structure in such a manner that you can add multiple applicants at one go. Nonetheless, we have 256-bit SSL protection for the entire website that keeps all your personal information 100% safe and secured.</p>\r\n</div>\r\n\r\n<div class=\"how_apply_inner_images\">&nbsp;</div>\r\n\r\n<div class=\"clr\">&nbsp;</div>\r\n</div>\r\n\r\n<div class=\"clr\">&nbsp;</div>\r\n</div>\r\n\r\n<div class=\"how_apply_inner4\">\r\n<div class=\"how_apply_inner_left\">\r\n<h1>Step 4</h1>\r\n\r\n<h4>MAKE SECURED<br />\r\nONLINE<br />\r\nPAYMENT</h4>\r\n\r\n<div class=\"l_arrow\"><img src=\"https://www.thedubaivisa.com/public/front/includes/images/arrow4.png\" /></div>\r\n</div>\r\n\r\n<div class=\"how_apply_inner_right\">\r\n<div class=\"how_apply_inner_content\">\r\n<p>Now paying your UAE Visa fee is absolutely simple and secured through our trusted payment gateway, which is well-protected under 256-bit SSL. In addition, our online payment options also allow you to make the payment using your debit card as well as your credit card</p>\r\n</div>\r\n\r\n<div class=\"how_apply_inner_images\">&nbsp;</div>\r\n\r\n<div class=\"clr\">&nbsp;</div>\r\n</div>\r\n\r\n<div class=\"clr\">&nbsp;</div>\r\n</div>\r\n\r\n<div class=\"clr\">&nbsp;</div>\r\n</div>\r\n<!--end how_apply-->', '150027012420170717.jpg', '1', 'How to apply', 'How to apply', 'How to apply', '2017-07-17 05:42:04', '2017-07-17 05:42:04');
